ERROR - 2017-11-26 11:19:38 --> Query error: Unknown column 'ind_nama' in 'field list' - Invalid query: INSERT INTO `m_otomotif_performa` (`ind_nama`, `en_nama`, `link_code`, `ind_content`, `en_content`, `ind_faq`, `en_faq`, `ind_warranty`, `en_warranty`) VALUES ('V-KOOL 701', 'V-KOOL 701', 'v-kool-70', '<p><span style=\"color:rgb(102, 102, 102); font-size:15px\">Selektifitas spektrum yang spektakuler pada lapisan kaca film V-KOOL merupakan terobosan signifikan di Ilmu Pengetahuan Permukaan dan Partikel (Surface &amp; Particle Science) dan di industri kaca film.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(102, 102, 102); font-size:15px\">Sebagai pemenang dari Technology of The Year Award 1989, lapisan V-KOOL adalah pelopor dan satu-satunya kaca film selektif yang spektakular yang menawarkan kemungkinan-kemungkinan baru bagi para arsitektur, interior designer, produsen mobil, pemilik mobil dan pemililik property.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(102, 102, 102); font-size:15px\">Jenis-jenis V-KOOL (40, 70, VIP) masing-masing mempunyai keunikan performance tersendiri yang hingga kini belum tersaingi. V-KOOL 70 mempunyai &#39;keunikan&#39; VLT (Visible Light Transmission yaitu cahaya tampak) yang tinggi juga di ikuti penolakan sinar Ultra-violet dan infra-merah (penyebab panas) yang tinggi pula.&nbsp;</span><br />\r\n<br />\r\n<span style=\"color:rgb(102, 102, 102); font-size:15px\">V-KOOL 70 menjadi solusi terbaik untuk bangunan dan untuk para pemilik mobil dan diterima secara luas di manca negara merupakan contoh yang sangat baik dari V-KOOL 70 sebagai lapisan selektif yang spektakuler sejati.</span></p>\r\n', '<p>The spectacular spectrum selectivity of the V-KOOL film glass layer is a significant breakthrough in Surface &amp; Particle Science and in the film window industry.</p>\r\n\r\n<p>As the winner of the 1989 Technology of the Year Award, the V-KOOL coating is the pioneer and the only spectacular selective glass film that offers new possibilities for architects, interior designers, car manufacturers, car owners and property pemililik.</p>\r\n\r\n<p>The types of V-KOOL (40, 70, VIP) each have their own unique performance that has not been rivaled yet. V-KOOL 70 has &#39;high visibility&#39; Visible Light Transmission (visible light) is also followed by high rejection of Ultra-violet rays and infra-red (heat causes).</p>\r\n\r\n<p>V-KOOL 70 being the best solution for building and for car owners and widely accepted abroad is an excellent example of V-KOOL 70 as a truly spectacular selective coating.</p>\r\n', '<p>Tanya : Apakah V-Kool 70 Dapat digunakan pada kaca depan?</p>\r\n\r\n<p>Jawab : Ya. V-Kool 70 Memiliki VLT sebesar 70% sehingga pandangan tampak jelas/clear saat mengemudi.</p>\r\n\r\n<p>Tanya : Apakah V-Kool 70 mengganggu sinyal GPS?</p>\r\n\r\n<p>Jawab : Kemungkinan untuk GPS yang menggunakan sistem penerimaan sinyal frekwensi Band L2 akan mengalami gangguan.</p>\r\n', '<p>Question: Is V-Kool 70 Can be used on windshield?</p>\r\n\r\n<p>Answer yes. V-Kool 70 Has a VLT of 70% so the view is clear while driving.</p>\r\n\r\n<p>Question: Does V-Kool 70 interfere with GPS signal?</p>\r\n\r\n<p>Answer: The possibility for GPS using Band L2 frequency signal receiving system will be interrupted.</p>\r\n', '<p><span style=\"color:rgb(102, 102, 102); font-size:15px\">5 Tahun produk garansi</span></p>\r\n', '<p><span style=\"color:rgb(102, 102, 102); font-size:15px\">5 Years Limited Product Warranty</span></p>\r\n')
